import "./App.css";
import Header from "./Elements/Header/Header";
import Content from "./Elements/Content/Content";
import Footer from "./Elements/Footer/Footer";

function App() {
  return (
    <div className="App" style={{ height: "100vh" }}>
      <header className="App-header">
        <Header />
        <Content />
        <Footer />
      </header>
    </div>
  );
}

export default App;
